<node COLOR="#444E53"   CREATED="1593089316000" LINK="https://marmotta.apache.org/kiwi/index.html" ID="Freemind_Link_1548962112" MODIFIED="1593089367000" TEXT="Kiwi Triplestore">
<font SIZE="12"/><richcontent TYPE="NOTE"><html><head></head><body>&lt;span style=&apos;color: rgb(51, 51, 51);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;The KiWi triple store is a high performance transactional triple store backend for &lt;/span&gt;&lt;a class=&quot;externalLink&quot; href=&quot;http://www.openrdf.org/&quot; style=&apos;color: rgb(203, 17, 128);background-image:none;background-position:right center;background-color: rgb(255, 255, 255);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;&apos;&gt;OpenRDF Sesame&lt;/a&gt;&lt;span style=&apos;color: rgb(51, 51, 51);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt; building on top of a relational database (currently &lt;/span&gt;&lt;a class=&quot;externalLink&quot; href=&quot;http://www.h2database.com/&quot; style=&apos;color: rgb(203, 17, 128);background-image:none;background-position:right center;background-color: rgb(255, 255, 255);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;&apos;&gt;H2&lt;/a&gt;&lt;span style=&apos;color: rgb(51, 51, 51);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;, &lt;/span&gt;&lt;a class=&quot;externalLink&quot; href=&quot;http://www.postgresql.org/&quot; style=&apos;color: rgb(203, 17, 128);background-image:none;background-position:right center;background-color: rgb(255, 255, 255);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;&apos;&gt;PostgreSQL&lt;/a&gt;&lt;span style=&apos;color: rgb(51, 51, 51);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;, or &lt;/span&gt;&lt;a class=&quot;externalLink&quot; href=&quot;http://www.mysql.com/&quot; style=&apos;color: rgb(203, 17, 128);background-image:none;background-position:right center;background-color: rgb(255, 255, 255);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;&apos;&gt;MySQL&lt;/a&gt;&lt;span style=&apos;color: rgb(51, 51, 51);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;). It has optional support for &lt;/span&gt;&lt;a href=&quot;https://marmotta.apache.org/kiwi/reasoner.html&quot; style=&apos;color: rgb(203, 17, 128);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;rule-based reasoning (sKWRL)&lt;/a&gt;&lt;span style=&apos;color: rgb(51, 51, 51);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt; and &lt;/span&gt;&lt;a href=&quot;https://marmotta.apache.org/kiwi/versioning.html&quot; style=&apos;color: rgb(203, 17, 128);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;versioning of updates&lt;/a&gt;&lt;span style=&apos;color: rgb(51, 51, 51);font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 13px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;. The KiWi triple store is also the default backend for Apache Marmotta. It originated in the EU-funded research project “KiWi - Knowledge in a Wiki” (hence the name).&lt;/span&gt;</body></html></richcontent><arrowlink COLOR="#8acc47" DESTINATION="Freemind_Link_1548959750" ENDARROW="Default" ID="Arrow_ID_28555056" STARTARROW="None"/></node>
