<font SIZE="14" BOLD="true"/><node COLOR="#444E53"   CREATED="1584413790000" LINK="https://www.w3.org/wiki/Lists_of_ontologies" ID="Freemind_Link_1440560125" MODIFIED="1584413822000" TEXT="Lists of ontologies - W3C Wiki">
<font SIZE="12"/><node COLOR="#444E53"   CREATED="1584413906000" LINK="http://www.foaf-project.org/" ID="Freemind_Link_1440560590" MODIFIED="1584414110000" TEXT="The FOAF Project">
<font SIZE="12"/><richcontent TYPE="NOTE"><html><head></head><body>&lt;h2 style=&apos;color: black;background:none rgb(255, 255, 255);font-weight: normal;margin-top:1em;margin-bottom:0.25em;overflow: hidden;border-bottom:1px solid rgb(170, 170, 170);font-family: &quot;Linux Libertine&quot;, Georgia, Times, serif;line-height: 1.3;white-space: normal;&apos;&gt;&lt;span class=&quot;mw-headline&quot;&gt;The Friend Of A Friend (FOAF) ontology&lt;/span&gt;&lt;/h2&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Project homepage:&lt;/b&gt; &lt;a class=&quot;external free&quot; href=&quot;http://www.foaf-project.org/&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;http://www.foaf-project.org/&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Namespace:&lt;/b&gt; &lt;a class=&quot;external free&quot; href=&quot;http://xmlns.com/foaf/0.1/&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;http://xmlns.com/foaf/0.1/&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Typical prefix:&lt;/b&gt; foaf:&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Documentation:&lt;/b&gt; &lt;a class=&quot;external free&quot; href=&quot;http://xmlns.com/foaf/spec/&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;http://xmlns.com/foaf/spec/&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Description:&lt;/b&gt; this ontology is used to describe people and social relationship on the Web. It is mostly focused on people&apos;s existence in the virtual world, with many properties related to online activity or identity: foaf:mbox, foaf:skypeID, foaf:msnID, foaf:geekcode, etc. Nothing about family relations, physical address... It provides similar information on organisations or groups with a similar focus on their existence on the Web (work place webpage, etc). It is particularly well suited for describing people on Web-based Social platforms (facebook, twitter, blogspot, ...).&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Which datasets use it:&lt;/b&gt; FOAF is used on many different websites. The list would be too long for this page. Notable examples are: Live Journal, etc. Many computer scentists in the Semantic Web field all over the world are publishing their personal FOAF file.&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Tools supporting it:&lt;/b&gt; &lt;a class=&quot;external text&quot; href=&quot;http://www.ldodds.com/foaf/foaf-a-matic&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;FOAF-a-Matic&lt;/a&gt; is a Web-based app which allows the user to create a FOAF file quickly by entering natural language text information in a Web form. The &lt;a class=&quot;external text&quot; href=&quot;http://wiki.foaf-project.org/&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;Wiki&lt;/a&gt; of the FOAF project has a &lt;a class=&quot;external text&quot; href=&quot;http://wiki.foaf-project.org/w/Tools&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;webpage listing many FOAF-related tools&lt;/a&gt;.&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Technicalities:&lt;/b&gt; FOAF is a rather small ontology (19 classes, 44 object properties, 27 datatype properties). It is not an OWL 2 DL ontology because it relies on inverse functional datatype properties. However, apart from this small issue and minor syntactical issues, the ontology is essentially compatible with OWL 2 RL, which means it is particularly suitable for materialising implicit knowledge about FOAF data in a triple store.&lt;/p&gt;</body></html></richcontent></node>
<node COLOR="#444E53"   CREATED="1584413951000" LINK="http://sioc-project.org/" ID="Freemind_Link_1440560799" MODIFIED="1584414112000" TEXT="SIOC Project">
<font SIZE="12"/><richcontent TYPE="NOTE"><html><head></head><body>&lt;h2 style=&apos;color: black;background:none rgb(255, 255, 255);font-weight: normal;margin-top:1em;margin-bottom:0.25em;overflow: hidden;border-bottom:1px solid rgb(170, 170, 170);font-family: &quot;Linux Libertine&quot;, Georgia, Times, serif;line-height: 1.3;white-space: normal;&apos;&gt;&lt;span class=&quot;mw-headline&quot;&gt;Socially Interconnected Online Communities (SIOC) ontology&lt;/span&gt;&lt;/h2&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Project homepage:&lt;/b&gt; &lt;a class=&quot;external free&quot; href=&quot;http://sioc-project.org/&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;http://sioc-project.org/&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Namespace:&lt;/b&gt; &lt;a class=&quot;external free&quot; href=&quot;http://rdfs.org/sioc/ns#&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;http://rdfs.org/sioc/ns#&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Typical prefix:&lt;/b&gt; sioc:&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Documentation:&lt;/b&gt; &lt;a class=&quot;external free&quot; href=&quot;http://rdfs.org/sioc/spec/&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;http://rdfs.org/sioc/spec/&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Description:&lt;/b&gt; this ontology is used to describe online communities such as forums, blogs, mailing lists, wikis. It complements FOAF by stressing on the description of the products of those communities (posts, replies, threads, etc).&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Which datasets use it:&lt;/b&gt; SIOC is used on many different websites. Notable examples are: ???.&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Tools supporting it:&lt;/b&gt; most notably, Wordpress and Drupal have a module supporting it. There is a &lt;a class=&quot;external text&quot; href=&quot;http://sioc-project.org/applications&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;page that references many applications using SIOC&lt;/a&gt;.&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Technicalities:&lt;/b&gt; SIOC is a lightweight ontology (17 classes, 61 object properties, 25 datatype properties). It is essentially in OWL 2 DL, with tiny syntactical issues that strictly speaking makes it a non DL ontology. It only relies on OWL 2 RL constructs.&lt;/p&gt;</body></html></richcontent></node>
<node COLOR="#444E53"   CREATED="1584414179000" LINK="https://www.dublincore.org/" ID="Freemind_Link_1440562212" MODIFIED="1584414204000" TEXT="DCMI: Home">
<font SIZE="12"/><richcontent TYPE="NOTE"><html><head></head><body>&lt;h2 style=&apos;color: black;background:none rgb(255, 255, 255);font-weight: normal;margin-top:1em;margin-bottom:0.25em;overflow: hidden;border-bottom:1px solid rgb(170, 170, 170);font-family: &quot;Linux Libertine&quot;, Georgia, Times, serif;line-height: 1.3;white-space: normal;&apos;&gt;&lt;span class=&quot;mw-headline&quot;&gt;The Dublin Core (DC) ontology&lt;/span&gt;&lt;/h2&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Project homepage:&lt;/b&gt; &lt;a class=&quot;external free&quot; href=&quot;http://dublincore.org/&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;http://dublincore.org/&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Namespace:&lt;/b&gt; &lt;a class=&quot;external free&quot; href=&quot;http://purl.org/dc/elements/1.1/&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;http://purl.org/dc/elements/1.1/&lt;/a&gt; and &lt;a class=&quot;external free&quot; href=&quot;http://purl.org/dc/terms/&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;http://purl.org/dc/terms/&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Typical prefix:&lt;/b&gt; dc: and dcterm:&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Documentation:&lt;/b&gt; &lt;a class=&quot;external free&quot; href=&quot;http://dublincore.org/specifications/&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;http://dublincore.org/specifications/&lt;/a&gt;&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Description:&lt;/b&gt; this is a light weight RDFS vocabulary for describing generic metadata.&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Which datasets use it:&lt;/b&gt; DC is ubiquitous in the Linked Data landscape.&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Tools supporting it:&lt;/b&gt; the &lt;a class=&quot;external text&quot; href=&quot;http://protege.stanford.edu/&quot; style=&quot;color: rgb(102, 51, 102);padding-right:13px;&quot;&gt;Protégé&lt;/a&gt; ontology editor provides DC properties as default annotation properties for ontologies and ontological terms. Providing DC annotations is also very common in other Semantic Web editors.&lt;/p&gt;&lt;p style=&quot;margin-top:0.5em;margin-bottom:0.5em;line-height: inherit;color: rgb(37, 37, 37);font-family: sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Technicalities:&lt;/b&gt; DC is a moderately small ontology divided into 2 vocabularies: DC elements and DC terms. DC elements contain 15 properties. DC terms contain 22 classes and 55 properties. It is not an OWL 2 DL ontology because it does not rely at all on the OWL constructs. This actually makes it a very simple ontology to reason with. Since the terms are weakly constrained, it is often the case that ontologies reusing them are redefining the terms internally instead of importing the DC ontology. This way, it is possible to choose, e.g., whether the properties are AnnotationProperties, etc. without breaking the compatibility with, for instance OWL DL.&lt;/p&gt;</body></html></richcontent></node>
