<font SIZE="12"/><node COLOR="#444E53"   CREATED="1584412321000" LINK="https://github.com/Kaljurand/owl-verbalizer" ID="Freemind_Link_1440549129" MODIFIED="1584412398000" TEXT="owl-Verbalizer">
<font SIZE="12"/><richcontent TYPE="NOTE"><html><head></head><body>&lt;p style=&apos;margin-bottom:16px;color: rgb(36, 41, 46);font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;font-size: 16px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;OWL verbalizer is a tool that converts an OWL ontology into an Attempto Controlled English (ACE) text.&lt;/p&gt;&lt;p style=&apos;margin-bottom:16px;color: rgb(36, 41, 46);font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;font-size: 16px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;It can handle complex OWL formulas such as&lt;/p&gt;&lt;pre style=&apos;font-family: SFMono-Regular, Consolas, &quot;Liberation Mono&quot;, Menlo, monospace;font-size: 13.6px;margin-bottom:16px;padding:16px;overflow: auto;line-height: 1.45;background-color: rgb(246, 248, 250);border-radius:3px;color: rgb(36, 41, 46);&apos;&gt;&lt;code style=&apos;font-family: SFMono-Regular, Consolas, &quot;Liberation Mono&quot;, Menlo, monospace;font-size: 13.6px;border-radius:3px;border:0px;display: inline;overflow: visible;line-height: inherit;&apos;&gt;man
	and (not (own some car))
	and (own some bike)
SubClassOf inverse (likes) some ({Mary})
&lt;/code&gt;&lt;/pre&gt;&lt;p style=&apos;margin-bottom:16px;color: rgb(36, 41, 46);font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;;font-size: 16px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;by turning them into natural English sentences such as:&lt;/p&gt;&lt;pre style=&apos;font-family: SFMono-Regular, Consolas, &quot;Liberation Mono&quot;, Menlo, monospace;font-size: 13.6px;margin-bottom:16px;padding:16px;overflow: auto;line-height: 1.45;background-color: rgb(246, 248, 250);border-radius:3px;color: rgb(36, 41, 46);&apos;&gt;&lt;code style=&apos;font-family: SFMono-Regular, Consolas, &quot;Liberation Mono&quot;, Menlo, monospace;font-size: 13.6px;border-radius:3px;border:0px;display: inline;overflow: visible;line-height: inherit;&apos;&gt;Every man
	that owns a bike
	and
	that does not own a car
is liked by Mary .&lt;/code&gt;&lt;/pre&gt;</body></html></richcontent></node>
