<font SIZE="12"/><richcontent TYPE="NOTE"><html><head></head><body>&lt;span style=&apos;color: rgb(114, 114, 114);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;HyperGraphQL is a &lt;/span&gt;&lt;a href=&quot;http://graphql.org/&quot; style=&apos;color: rgb(38, 124, 185);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;GraphQL&lt;/a&gt;&lt;span style=&apos;color: rgb(114, 114, 114);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt; interface for querying and serving &lt;/span&gt;&lt;a href=&quot;https://www.w3.org/standards/semanticweb/data&quot; style=&apos;color: rgb(38, 124, 185);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;linked data&lt;/a&gt;&lt;span style=&apos;color: rgb(114, 114, 114);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt; on the Web. It is designed to support federated querying and exposing data from multiple linked data services using GraphQL query language and schemas. The core of the response is a &lt;/span&gt;&lt;a href=&quot;https://json-ld.org/&quot; style=&apos;color: rgb(38, 124, 185);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;JSON-LD&lt;/a&gt;&lt;span style=&apos;color: rgb(114, 114, 114);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt; object, which extends the standard JSON with the &lt;/span&gt;&lt;a href=&quot;https://json-ld.org/spec/latest/json-ld-api-best-practices/#dfn-json-ld-context&quot; style=&apos;color: rgb(38, 124, 185);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;JSON-LD context&lt;/a&gt;&lt;span style=&apos;color: rgb(114, 114, 114);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt; enabling semantic disambiguation of the contained data.&lt;/span&gt;&lt;div&gt;&lt;span style=&apos;color: rgb(114, 114, 114);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&apos;color: rgb(114, 114, 114);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;Sources:&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&apos;color: rgb(114, 114, 114);font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;font-size: 14px;white-space: normal;background-color: rgb(255, 255, 255);&apos;&gt;&lt;a href=&quot;https://github.com/hypergraphql&quot;&gt;https://github.com/hypergraphql&lt;/a&gt;&lt;br/&gt;&lt;/span&gt;&lt;/div&gt;</body></html></richcontent></node>
</node>
